SELECT * FROM companies.company_info;

select distinct category from company_info;
select count(*) from company_info;

select company, count(*) from company_info where company = 'Facebook' group by company;


-- sum each companies money
-- sum(), max(), min(), avg(), count() + group by
select company, sum(raised_amount) from company_info where company = 'Facebook' group by company;
select * from company_info where company = 'Facebook';

-- alias
select company , min(raised_amount) as 'money' from company_info group by company order by money;

-- ascending, asc - восходящий - 0..100
-- descending, desc - нисходящий - 100..0
select company , max(raised_amount) as 'money' from company_info group by company order by money desc, company asc;

-- facebook 10 - 1
-- abc		20 - 2
-- abc		2
-- facebook 1

select count(distinct company) as 'company_count' from company_info where funded_date between '2005-01-01' and '2008-12-31';

